import styled from "styled-components"

export const VerticalContainer = styled.div`
  height: 100vh;
  background-color: yellow;
  display: flex;
  align-items: center;
  justify-content: center;
`

export const DivCentered = styled.div`
  display: flex;
  flex-direction: column;
  flex: 1;
  align-items: center;
  background-color: red;
`
